import { useAppContext } from "./context/appcontext";
import withDashboardContext from "./hoc/withDashboardContext";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const { activeStudents } = useAppContext();
  const navigate = useNavigate();

  return (
    <div>
      <div
        style={{
          display: "flex",
          background: "indianred",
          color: "white",
          justifyContent: "space-around",
          alignItems: "center",
        }}
      >
        <h1>ADMINISTRATOR</h1>
        <span
          onClick={() => {
            localStorage.removeItem("accessToken");
            localStorage.removeItem("user");
            localStorage.removeItem("date");
            navigate("/");
          }}
        >
          Logout
        </span>
      </div>
      <div style={{ background: "#ccc" }}>
        <div style={{ background: "white" }}>
          <p>
            {`Dear ${JSON.parse(localStorage.getItem("user")!)!.fullName}`},
            Welcome
          </p>
          <div>
            <span>Active Users</span>
            <span>Total Count: {activeStudents?.length}</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default withDashboardContext(Dashboard);
